[Form]
public class VendJournalMatch_PackingSlip extends FormRun
{
    InventDimCtrl_Frm_Mov inventDimFormSetup;
    PurchJournalMatch_Invoice journalSelect;
    PmfFormCtrl_VendJournalMatch_PackingSlip formCtrl;
    FormObservableLink vendPackingSlipTransObservableLink = new FormObservableLink();

}

public void closeOk()
{
    // in Approved state the OK button is disabled so no need to check for Approved
    if (vendInvoiceInfoTable.RequestStatus == VendInvoiceRequestStatus::InReview && VendInvoiceInfoSubLine::existUnmatched('', vendInvoiceInfoTable.TableRefId))
    {
        warning("@SYS331809");

        return;
    }

    journalSelect.closeOK();

    super();
}

public void init()
{
    TableId tableId;
    boolean singleVendInvoiceInfoLine;

    if (#PdsCatchWeightEnabled)
    {
        formCtrl = PmfFormCtrl_VendJournalMatch_PackingSlip::newFormRun(element);
        formCtrl.initPre();
    }

    super();

    journalSelect = SalesPurchJournalSelect::newPurchPackingSlipJournalSelect(DocumentStatus::PackingSlip, element);

    tableId = this.args().record().TableId;

    if (tableId == tableNum(VendInvoiceInfoTable))
    {
        singleVendInvoiceInfoLine = false;
        vendInvoiceInfoTable.data(this.args().record());
    }
    else if (tableId == tableNum(VendInvoiceInfoLine)) // limit the upper grid to just one line
    {
        singleVendInvoiceInfoLine = true;
        vendInvoiceInfoLine.data(this.args().record());
        vendInvoiceInfoTable.data(vendInvoiceInfoLine.vendInvoiceInfoTable());
        journalSelect.vendInvoiceInfoLine(vendInvoiceInfoLine);
        vendInvoiceInfoLine_ds.query().dataSourceTable(tableNum(VendInvoiceInfoLine)).addRange(fieldNum(VendInvoiceInfoLine, RecId)).value(SysQuery::value(vendInvoiceInfoLine.RecId));
    }

    commandButtonOK.enabled(vendInvoiceInfoTable.RequestStatus != VendInvoiceRequestStatus::Approved);
    buttonMatchAllPurchParmLines.enabled(!singleVendInvoiceInfoLine);
    buttonUnMatchAllPurchParmLines.enabled(!singleVendInvoiceInfoLine);
    quantityMatch.visible(VendParameters::find().editUseInvoiceMatching() == NoYes::Yes);

    element.updateDesign(InventDimFormDesignUpdate::Init);
    journalSelect.buildPackingSlipLink();

    if (formCtrl)
    {
        formCtrl.initPost();
    }
}

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    PurchLine purchLine;

    InventMovement movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

