public edit Qty purchQtyToInvoice(boolean _set, VendPackingSlipTrans _vendPackingSlipTrans, PurchQty _purchQtyToInvoice)
{
    PurchQty purchQtyToInvoice = journalSelect.purchQtyToInvoice(_set, _vendPackingSlipTrans, _purchQtyToInvoice);
    if (VendorInvoiceQuantityAutoRoundingFeatureV3::instance().isEnabled())
    {
        purchQtyToInvoice = VendInvoiceUnitOfMeasureRounding::roundedQuantityBasedOnUnitOfMeasure(purchQtyToInvoice, _vendPackingSlipTrans.PurchUnit);
    }

    if (_set)
    {
        vendInvoiceInfoLine_ds.refresh();
    }

    vendPackingSlipTransObservableLink.observe();

    return purchQtyToInvoice;
}

